pragma solidity  ^0.4.24;

contract Career {
    struct Careerinfo {
        string m_code;
        string join_date;
        string end_date;
        string work_place_name;
    }

    mapping(string => Careerinfo) careerinfo;


    function addCareer(string em_code,
                        string _m_code,
                        string _join_date,
                        string _end_date,
                        string _work_place_name) public {
                	         
        careerinfo[em_code] = Careerinfo(_m_code,_join_date,_end_date,_work_place_name);
    }

    function getCareer(string em_code) public view returns (string,string,string,string) {
        Careerinfo memory cc = careerinfo[em_code];
        return (
                cc.m_code,
                cc.join_date,
                cc.end_date,
                cc.work_place_name
        );
    }

}
